    text-align: left;
    color: rgb(105, 105, 105);
    margin: 0;
}

.surveyScreen.surveyRuntimeSurvey .surveyRuntimeBaseAnswer .description h2 {
	display: block;
    font-family: "NokiaPureHeadline_Ultralight", "Salesforce Sans", Arial, Helvetica, sans-serif !important;
    font-size: 14px;

}

.surveyScreen.surveyRuntimeSurvey .surveyAnswerTextarea .surveyTextArea {
    width: 100%;
}
.surveyScreen.surveyRuntimeSurvey .surveyAnswerTextarea textarea {
    border-color: #d4d4d4;
    border-width: 1px;
}

.surveyScreen.surveyRuntimeSurvey .surveyRuntimeActionBar .navigationButtons button.slds-button--neutral {
    border-color: #BEC8D2;
    border-style: solid;
    border-width: 1px;
}
button.slds-button.slds-button--neutral.not-selected.slds-not-selected.uiButton {
    display: none;
